import React, {Component} from "react";
import "./App.css";
import Navbar  from "./Navbar"

class App extends Component {
    render(){
        return(
            <div>
            <Navbar/>
            <div>
                <h1>Hello World!</h1>
            </div>
            </div>
        );
    }
}

export default App;
